/*Procedimentos para inserir e remover elementos da pilha
 * */
void push(Celula *c){

	NodePilha *nptr = calloc(1,sizeof(NodePilha));
	nptr->dado = c;
	nptr->prox = topo;
	topo = nptr;
}

void pop(){
	if(topo != NULL){
		NodePilha *aux;
		aux =topo;
		topo = topo->prox;
		free(aux);
	}
}

/*Procedimento cria uma célula do tipo combinador.
 * */
Celula *cria_combinador(char *entrada){
	Celula *combinador;
	combinador = malloc( sizeof(Celula) );
	combinador->tipo = entrada[0];
	combinador->fdir = NULL;
	combinador->fesq = NULL;
	return combinador;
}

//Procedimento que recebe duas variáveis, uma que aponta para
//um array e outra que aponta para um inteiro com a posição do
//array a ser usada. O procedimento termina quando atinge a
//primeira posição depois dos parênteses.
void casa_parenteses(char* array1, int* p) {
    int paren = 1;
    int c = *p;
    while (paren != 0) {
        switch (array1[c]) {
            case '(':
                paren++;
                c++;
                break;
            case ')':
                paren--;
                c++;
                break;
            default:
                c++;
        }
    }
    *p = c;
}

/*Procedimento cria uma célula do tipo aplicação(@) com
 * os filhos da direita e da esquerda nulos
 * */
Celula *cria_aplicacao(){
	Celula *aplicacao;
	aplicacao = malloc(sizeof(Celula));
	aplicacao->tipo = '@';
	aplicacao->fdir = NULL;
	aplicacao->fesq = NULL;
	return aplicacao;
}

/*Procedimento pega a string de entrada e a partir da mesma cria o grafo
 * fazendo uma busca em ordem de baixo para cima
 * */
Celula* cria_grafo(char *entrada){

	Celula *raiz = cria_aplicacao();

	while(entrada[0] != '\0'){

			if(entrada[0] == ')'){
					return raiz;
			}
			else if(entrada[0] == '('){
				if(raiz->fdir != NULL){
					Celula *ap = cria_aplicacao();
					Celula *aux = raiz;
					ap->fesq = aux;
					ap->fdir = cria_grafo(entrada + 1);
					raiz = ap;
				}
				else{
					raiz->fdir= cria_grafo(entrada + 1);
				}
				int end   = 1;
				casa_parenteses(entrada,&end);
				for(int i = 0; i < end; i++){
					entrada++;
				}
			}
			else{
				if(raiz->fesq == NULL){
					Celula *comb = cria_combinador(entrada);
					raiz->fesq = comb;
					entrada++;
				}
				else if(raiz->fdir == NULL){
					Celula *comb = cria_combinador(entrada);
					raiz->fdir = comb;
					entrada++;
				}
				else{
					Celula *ap = cria_aplicacao();
					Celula *aux  = raiz;
					ap->fesq  = aux;
					raiz  = ap;
				}
			}
	}

	return raiz;
}

/*Procedimento cria um grafo dedicado a free list, gerando uma árvore em pré ordem
 * */
Celula* aloca_freelist(Celula *heap, Celula *raiz){
	//malloc(sizeof(Celula));
	raiz = &heap[0];
	Celula *ptr = raiz;
	for(int i = 1;i < 100;i++){
		ptr->fesq = &heap[i];
		ptr = ptr->fesq;
	}

	return raiz;

}

/*Procedimento pega o grafo criado e o aloca na heap. fazendo uma busca
 * em pré ordem.
 * Argumentos: heap aponta para o elemento inicial da heap
 *             cel aponta para a raiz do grafo
 *
 * */
void aloca_grafo(Celula *heap,Celula *cel,int *idx,Freelist *fl,List*l){

	heap[*idx] = *cel;
	(*idx)++;
	fl->fl_pointer = &heap[*idx];

	if(cel->fesq != NULL){
		aloca_grafo(heap,cel->fesq,idx,fl,l);
	}
	if(cel->fdir != NULL){
		aloca_grafo(heap,cel->fdir,idx,fl,l);
	}
}


/*Procedimento dedicado a impressão do grado no console
 * para verificar se o grafo criado está correto.
 * */
void imprime_grafo_para_string(Celula *cel){

	if(cel->tipo != '@'){
		printf("%c",cel->tipo);
	}
	else{
		if(cel->fesq != NULL){
			imprime_grafo_para_string(cel->fesq);
		}
		if(cel->fdir != NULL){
			if(cel->fdir->tipo == '@'){
				printf("(");
				imprime_grafo_para_string(cel->fdir);
				printf(")");
			}
			else{
				imprime_grafo_para_string(cel->fdir);
			}
		}
	}
}


void imprime_grafo(Celula *cel){

	printf("%c",cel->tipo);
	if(cel->fesq != NULL){
		imprime_grafo(cel->fesq);
	}
	if(cel->fdir != NULL){
		imprime_grafo(cel->fdir);
	}

}

//Reduções
/*Procedimento efetua a redução do combinador K segundo a regra
 * K a b -> A
 * */
void reduz_K(Celula *grafo){

	pop();//Desempilha K

	//Buscando argumentos
	NodePilha *arg1 = topo;
	Celula *a  = arg1->dado->fdir;
	pop();// Desenpilha a
	pop();// Desempilha b

	Celula *pai = NULL;

	//K a b -> a
	Celula *newA = calloc(1,sizeof(Celula));
	newA->tipo = a->tipo;
	newA->fdir = a->fdir;
	newA->fesq = a->fesq;


	if(topo != NULL){
		pai = topo->dado;
		pai->fesq = newA;
		Celula *aux = newA;
		while(aux != NULL){
				push(aux);
				aux = aux->fesq;
		}
	}
	else{
		grafo->tipo = newA->tipo;
		grafo->fdir = newA->fdir;
		grafo->fesq = newA->fesq;
		if(grafo->fesq){
			Celula *aux = grafo->fesq;
			while(aux != NULL){
				push(aux);
				aux = aux->fesq;
			}
		}
	}

}

/*Procedimento efetua a redução do combinador S segundo a regra
 * S a b c -> a c ( b c )
 * */
void reduz_S(Celula *grafo){
	//Buscando argumentos
	pop();//Desempilha S
	Celula *a = topo->dado->fdir;
	pop();

	Celula *b = topo->dado->fdir;
	pop();

	Celula *c = topo->dado->fdir;
	pop();

	Celula *pai = NULL;

	//S a b c -> a c ( b c )
	Celula *newA =calloc(1,sizeof(Celula));
	Celula *newB =calloc(1,sizeof(Celula));
	Celula *newC1 =calloc(1,sizeof(Celula));
	Celula *newC2 =calloc(1,sizeof(Celula));

	newA->tipo = a->tipo;
	newA->fdir = a->fdir;
	newA->fesq = a->fesq;

	newB->tipo = b->tipo;
	newB->fdir = b->fdir;
	newB->fesq = b->fesq;

	newC1->tipo = c->tipo;
	newC1->fdir = c->fdir;
	newC1->fesq = c->fesq;

	newC2->tipo = c->tipo;
	newC2->fdir = c->fdir;
	newC2->fesq = c->fesq;

	Celula *aplicacaoPai = cria_aplicacao();
	Celula *aplicacaoFesq = cria_aplicacao();
	Celula *aplicacaoFdir = cria_aplicacao();

	aplicacaoPai->fesq = aplicacaoFesq;
	aplicacaoPai->fdir = aplicacaoFdir;

	if(topo != NULL){
		pai = topo->dado;
	}

	push(aplicacaoPai);

	aplicacaoFesq->fesq = newA;
	aplicacaoFesq->fdir = newC1;

	aplicacaoFdir->fesq = newB;
	aplicacaoFdir->fdir = newC2;

	//Empilhando os filhos mais externos mais a esquerda
	Celula *aux = aplicacaoFesq;
	while(aux != NULL){
		push(aux);
		aux = aux->fesq;
	}

	if(pai != NULL){
			pai->fesq = aplicacaoPai;
	}
	else{
		grafo->tipo = aplicacaoPai->tipo;
		grafo->fdir = aplicacaoPai->fdir;
		grafo->fesq = aplicacaoPai->fesq;
	}
}

/*Procedimento empilha células dês de a raiz até o elemento mais externo mais
 * a esquerda
 * */
void empilha_grafo(Celula *grafo){
	Celula *g = grafo;
	while(g != NULL){
		push(g);
		g = g->fesq;
	}
}

